function [f1o, u1o, v1o, f2o, u2o, v2o, l1, l2, err, iter] = f1_f2_from_F(F, f1prior, u1prior, v1prior,f2prior, u2prior, v2prior, w1, w2, w3, w4)

niter = 150;

[U,D,V] = svd(F);

s1 = D(1,1);
s2 = D(2,2);

f1n(1) = f1prior;
u1n(1) = u1prior;
v1n(1) = v1prior;

f2n(1) = f2prior;
u2n(1) = u2prior;
v2n(1) = v2prior;


not_found = 1;

 k =1;

while not_found && k<=niter   
%for k = 1:niter
   
    cf1p1(k) = 1/w1*(s2*(2*V(1,1)*V(1,2)*f1n(k) + 2*V(2,1)*V(2,2)*f1n(k))*(U(1,2)*(U(3,2)*u2n(k) + U(1,2)*(f2n(k)^2 + u2n(k)^2) + U(2,2)*u2n(k)*v2n(k)) + U(2,2)*(U(3,2)*v2n(k) + U(2,2)*(f2n(k)^2 + v2n(k)^2) + U(1,2)*u2n(k)*v2n(k)) + U(3,2)*(U(3,2) + U(1,2)*u2n(k) + U(2,2)*v2n(k))) + s1*(2*f1n(k)*V(1,1)^2 + 2*f1n(k)*V(2,1)^2)*(U(1,1)*(U(3,2)*u2n(k) + U(1,2)*(f2n(k)^2 + u2n(k)^2) + U(2,2)*u2n(k)*v2n(k)) + U(2,1)*(U(3,2)*v2n(k) + U(2,2)*(f2n(k)^2 + v2n(k)^2) + U(1,2)*u2n(k)*v2n(k)) + U(3,1)*(U(3,2) + U(1,2)*u2n(k) + U(2,2)*v2n(k))));
    cf1p2(k) = 1/w1*(s1*(2*V(1,1)*V(1,2)*f1n(k) + 2*V(2,1)*V(2,2)*f1n(k))*(U(1,1)*(U(3,1)*u2n(k) + U(1,1)*(f2n(k)^2 + u2n(k)^2) + U(2,1)*u2n(k)*v2n(k)) + U(2,1)*(U(3,1)*v2n(k) + U(2,1)*(f2n(k)^2 + v2n(k)^2) + U(1,1)*u2n(k)*v2n(k)) + U(3,1)*(U(3,1) + U(1,1)*u2n(k) + U(2,1)*v2n(k))) + s2*(2*f1n(k)*V(1,2)^2 + 2*f1n(k)*V(2,2)^2)*(U(1,1)*(U(3,2)*u2n(k) + U(1,2)*(f2n(k)^2 + u2n(k)^2) + U(2,2)*u2n(k)*v2n(k)) + U(2,1)*(U(3,2)*v2n(k) + U(2,2)*(f2n(k)^2 + v2n(k)^2) + U(1,2)*u2n(k)*v2n(k)) + U(3,1)*(U(3,2) + U(1,2)*u2n(k) + U(2,2)*v2n(k))));
    
    cu1p1(k) = 1/w2*(s1*(U(1,1)*(U(3,2)*u2n(k) + U(1,2)*(f2n(k)^2 + u2n(k)^2) + U(2,2)*u2n(k)*v2n(k)) + U(2,1)*(U(3,2)*v2n(k) + U(2,2)*(f2n(k)^2 + v2n(k)^2) + U(1,2)*u2n(k)*v2n(k)) + U(3,1)*(U(3,2) + U(1,2)*u2n(k) + U(2,2)*v2n(k)))*(V(1,1)*V(3,1) + V(1,1)*(V(3,1) + 2*V(1,1)*u1n(k) + V(2,1)*v1n(k)) + V(1,1)*V(2,1)*v1n(k)) + s2*(U(1,2)*(U(3,2)*u2n(k) + U(1,2)*(f2n(k)^2 + u2n(k)^2) + U(2,2)*u2n(k)*v2n(k)) + U(2,2)*(U(3,2)*v2n(k) + U(2,2)*(f2n(k)^2 + v2n(k)^2) + U(1,2)*u2n(k)*v2n(k)) + U(3,2)*(U(3,2) + U(1,2)*u2n(k) + U(2,2)*v2n(k)))*(V(1,2)*V(3,1) + V(1,1)*(V(3,2) + 2*V(1,2)*u1n(k) + V(2,2)*v1n(k)) + V(1,2)*V(2,1)*v1n(k)));
