    cv1p1(k) = 1/w2*(s1*(U(1,1)*(U(3,2)*u2n(k) + U(1,2)*(f2n(k)^2 + u2n(k)^2) + U(2,2)*u2n(k)*v2n(k)) + U(2,1)*(U(3,2)*v2n(k) + U(2,2)*(f2n(k)^2 + v2n(k)^2) + U(1,2)*u2n(k)*v2n(k)) + U(3,1)*(U(3,2) + U(1,2)*u2n(k) + U(2,2)*v2n(k)))*(V(2,1)*V(3,1) + V(2,1)*(V(3,1) + V(1,1)*u1n(k) + 2*V(2,1)*v1n(k)) + V(1,1)*V(2,1)*u1n(k)) + s2*(U(1,2)*(U(3,2)*u2n(k) + U(1,2)*(f2n(k)^2 + u2n(k)^2) + U(2,2)*u2n(k)*v2n(k)) + U(2,2)*(U(3,2)*v2n(k) + U(2,2)*(f2n(k)^2 + v2n(k)^2) + U(1,2)*u2n(k)*v2n(k)) + U(3,2)*(U(3,2) + U(1,2)*u2n(k) + U(2,2)*v2n(k)))*(V(2,2)*V(3,1) + V(2,1)*(V(3,2) + V(1,2)*u1n(k) + 2*V(2,2)*v1n(k)) + V(1,1)*V(2,2)*u1n(k)));
    cv1p2(k) = 1/w2*(s1*(U(1,1)*(U(3,1)*u2n(k) + U(1,1)*(f2n(k)^2 + u2n(k)^2) + U(2,1)*u2n(k)*v2n(k)) + U(2,1)*(U(3,1)*v2n(k) + U(2,1)*(f2n(k)^2 + v2n(k)^2) + U(1,1)*u2n(k)*v2n(k)) + U(3,1)*(U(3,1) + U(1,1)*u2n(k) + U(2,1)*v2n(k)))*(V(2,2)*V(3,1) + V(2,1)*(V(3,2) + V(1,2)*u1n(k) + 2*V(2,2)*v1n(k)) + V(1,1)*V(2,2)*u1n(k)) + s2*(U(1,1)*(U(3,2)*u2n(k) + U(1,2)*(f2n(k)^2 + u2n(k)^2) + U(2,2)*u2n(k)*v2n(k)) + U(2,1)*(U(3,2)*v2n(k) + U(2,2)*(f2n(k)^2 + v2n(k)^2) + U(1,2)*u2n(k)*v2n(k)) + U(3,1)*(U(3,2) + U(1,2)*u2n(k) + U(2,2)*v2n(k)))*(V(2,2)*V(3,2) + V(2,2)*(V(3,2) + V(1,2)*u1n(k) + 2*V(2,2)*v1n(k)) + V(1,2)*V(2,2)*u1n(k)));
    
    
    cf2p1(k) = 1/w3*(s1*(2*U(1,1)*U(1,2)*f2n(k) + 2*U(2,1)*U(2,2)*f2n(k))*(V(1,1)*(V(3,1)*u1n(k) + V(1,1)*(f1n(k)^2 + u1n(k)^2) + V(2,1)*u1n(k)*v1n(k)) + V(2,1)*(V(3,1)*v1n(k) + V(2,1)*(f1n(k)^2 + v1n(k)^2) + V(1,1)*u1n(k)*v1n(k)) + V(3,1)*(V(3,1) + V(1,1)*u1n(k) + V(2,1)*v1n(k))) + s2*(2*f2n(k)*U(1,2)^2 + 2*f2n(k)*U(2,2)^2)*(V(1,1)*(V(3,2)*u1n(k) + V(1,2)*(f1n(k)^2 + u1n(k)^2) + V(2,2)*u1n(k)*v1n(k)) + V(2,1)*(V(3,2)*v1n(k) + V(2,2)*(f1n(k)^2 + v1n(k)^2) + V(1,2)*u1n(k)*v1n(k)) + V(3,1)*(V(3,2) + V(1,2)*u1n(k) + V(2,2)*v1n(k))));
    cf2p2(k) = 1/w3*(s2*(2*U(1,1)*U(1,2)*f2n(k) + 2*U(2,1)*U(2,2)*f2n(k))*(V(1,2)*(V(3,2)*u1n(k) + V(1,2)*(f1n(k)^2 + u1n(k)^2) + V(2,2)*u1n(k)*v1n(k)) + V(2,2)*(V(3,2)*v1n(k) + V(2,2)*(f1n(k)^2 + v1n(k)^2) + V(1,2)*u1n(k)*v1n(k)) + V(3,2)*(V(3,2) + V(1,2)*u1n(k) + V(2,2)*v1n(k))) + s1*(2*f2n(k)*U(1,1)^2 + 2*f2n(k)*U(2,1)^2)*(V(1,1)*(V(3,2)*u1n(k) + V(1,2)*(f1n(k)^2 + u1n(k)^2) + V(2,2)*u1n(k)*v1n(k)) + V(2,1)*(V(3,2)*v1n(k) + V(2,2)*(f1n(k)^2 + v1n(k)^2) + V(1,2)*u1n(k)*v1n(k)) + V(3,1)*(V(3,2) + V(1,2)*u1n(k) + V(2,2)*v1n(k))));
    
    cu2p1(k) = 1/w4*(s1*(V(1,1)*(V(3,1)*u1n(k) + V(1,1)*(f1n(k)^2 + u1n(k)^2) + V(2,1)*u1n(k)*v1n(k)) + V(2,1)*(V(3,1)*v1n(k) + V(2,1)*(f1n(k)^2 + v1n(k)^2) + V(1,1)*u1n(k)*v1n(k)) + V(3,1)*(V(3,1) + V(1,1)*u1n(k) + V(2,1)*v1n(k)))*(U(1,2)*U(3,1) + U(1,1)*(U(3,2) + 2*U(1,2)*u2n(k) + U(2,2)*v2n(k)) + U(1,2)*U(2,1)*v2n(k)) + s2*(V(1,1)*(V(3,2)*u1n(k) + V(1,2)*(f1n(k)^2 + u1n(k)^2) + V(2,2)*u1n(k)*v1n(k)) + V(2,1)*(V(3,2)*v1n(k) + V(2,2)*(f1n(k)^2 + v1n(k)^2) + V(1,2)*u1n(k)*v1n(k)) + V(3,1)*(V(3,2) + V(1,2)*u1n(k) + V(2,2)*v1n(k)))*(U(1,2)*U(3,2) + U(1,2)*(U(3,2) + 2*U(1,2)*u2n(k) + U(2,2)*v2n(k)) + U(1,2)*U(2,2)*v2n(k)));
    cu2p2(k) = 1/w4*(s1*(V(1,1)*(V(3,2)*u1n(k) + V(1,2)*(f1n(k)^2 + u1n(k)^2) + V(2,2)*u1n(k)*v1n(k)) + V(2,1)*(V(3,2)*v1n(k) + V(2,2)*(f1n(k)^2 + v1n(k)^2) + V(1,2)*u1n(k)*v1n(k)) + V(3,1)*(V(3,2) + V(1,2)*u1n(k) + V(2,2)*v1n(k)))*(U(1,1)*U(3,1) + U(1,1)*(U(3,1) + 2*U(1,1)*u2n(k) + U(2,1)*v2n(k)) + U(1,1)*U(2,1)*v2n(k)) + s2*(V(1,2)*(V(3,2)*u1n(k) + V(1,2)*(f1n(k)^2 + u1n(k)^2) + V(2,2)*u1n(k)*v1n(k)) + V(2,2)*(V(3,2)*v1n(k) + V(2,2)*(f1n(k)^2 + v1n(k)^2) + V(1,2)*u1n(k)*v1n(k)) + V(3,2)*(V(3,2) + V(1,2)*u1n(k) + V(2,2)*v1n(k)))*(U(1,2)*U(3,1) + U(1,1)*(U(3,2) + 2*U(1,2)*u2n(k) + U(2,2)*v2n(k)) + U(1,2)*U(2,1)*v2n(k)));
    
    cv2p1(k) = 1/w4*(s1*(V(1,1)*(V(3,1)*u1n(k) + V(1,1)*(f1n(k)^2 + u1n(k)^2) + V(2,1)*u1n(k)*v1n(k)) + V(2,1)*(V(3,1)*v1n(k) + V(2,1)*(f1n(k)^2 + v1n(k)^2) + V(1,1)*u1n(k)*v1n(k)) + V(3,1)*(V(3,1) + V(1,1)*u1n(k) + V(2,1)*v1n(k)))*(U(2,2)*U(3,1) + U(2,1)*(U(3,2) + U(1,2)*u2n(k) + 2*U(2,2)*v2n(k)) + U(1,1)*U(2,2)*u2n(k)) + s2*(V(1,1)*(V(3,2)*u1n(k) + V(1,2)*(f1n(k)^2 + u1n(k)^2) + V(2,2)*u1n(k)*v1n(k)) + V(2,1)*(V(3,2)*v1n(k) + V(2,2)*(f1n(k)^2 + v1n(k)^2) + V(1,2)*u1n(k)*v1n(k)) + V(3,1)*(V(3,2) + V(1,2)*u1n(k) + V(2,2)*v1n(k)))*(U(2,2)*U(3,2) + U(2,2)*(U(3,2) + U(1,2)*u2n(k) + 2*U(2,2)*v2n(k)) + U(1,2)*U(2,2)*u2n(k)));
    cv2p2(k) = 1/w4*(s1*(V(1,1)*(V(3,2)*u1n(k) + V(1,2)*(f1n(k)^2 + u1n(k)^2) + V(2,2)*u1n(k)*v1n(k)) + V(2,1)*(V(3,2)*v1n(k) + V(2,2)*(f1n(k)^2 + v1n(k)^2) + V(1,2)*u1n(k)*v1n(k)) + V(3,1)*(V(3,2) + V(1,2)*u1n(k) + V(2,2)*v1n(k)))*(U(2,1)*U(3,1) + U(2,1)*(U(3,1) + U(1,1)*u2n(k) + 2*U(2,1)*v2n(k)) + U(1,1)*U(2,1)*u2n(k)) + s2*(V(1,2)*(V(3,2)*u1n(k) + V(1,2)*(f1n(k)^2 + u1n(k)^2) + V(2,2)*u1n(k)*v1n(k)) + V(2,2)*(V(3,2)*v1n(k) + V(2,2)*(f1n(k)^2 + v1n(k)^2) + V(1,2)*u1n(k)*v1n(k)) + V(3,2)*(V(3,2) + V(1,2)*u1n(k) + V(2,2)*v1n(k)))*(U(2,2)*U(3,1) + U(2,1)*(U(3,2) + U(1,2)*u2n(k) + 2*U(2,2)*v2n(k)) + U(1,1)*U(2,2)*u2n(k)));
    
    
 
    
