    v1o = v1n(:,k);
    
    f2o = f2n(:,k);
    u2o = u2n(:,k);
    v2o = v2n(:,k);
    
    l1 = l1(k-1);
    l2 = l2(k-1);
  
    error = err(k-1);
    iter = k;
end



